import Link from "next/link";
import css from "./Navbar.css";
import NavLink from "../NavLink/NavLink.js"

const Navbar = props => (
  <div className={css.navbar}>
    <NavLink name="About Us" href="page/about/"/>
    <NavLink name="Portfolio" href="case-studies/"/>
    <NavLink name="What We Do" href="#what-we-do"/>
    <NavLink name="Who We Serve" href="#who-we-serve"/>
    <NavLink name="Contact Us" href="page/contact/"/>
  </div>
);

export default Navbar;
